text.Taxonomy:
Eucalyptus phenax was first formally described in 1996 by Ian Brooker and Andrew Slee from material collected by Dean Nicolle near Tailem Bend in 1985.In 2000, Dean Nicolle described two subspecies and the names have been accepted by the Australian Plant Census:
Eucalyptus phenax subsp. compressa D. Nicolle that has longer peduncles, larger flower buds and fruit than subspecies phenax;
Eucalyptus phenax Brooker & Slee subsp. phenax.
